#include <iostream>
#include <string.h>
#include <vector>

// #define INPUT "ULL\nRRDDD\nLURDL\nUUUUD"
#define INPUT "\\\\"

using namespace std;

int main() {
  int keypad[5][5] = {
    { 0,  0,  1,   0, 0 },
    { 0,  2,  3,   4, 0 },
    { 5,  6,  7,   8, 9 },
    { 0, 10,  11, 12, 0 },
    { 0,  0,  13,  0, 0 },
  };

  int j = 2;
  int k = 0;

  for (int i = 0; i <= strlen(INPUT); i++) {
    switch(INPUT[i]) {
      case 'L':
        if (keypad[j][k - 1] != 0 && k != 0) {
          k -= 1;
        }
        break;
      case 'R':
        if (keypad[j][k + 1] != 0 && k != 4) {
          k += 1;
        }
        break;
      case 'U':
        if (keypad[j - 1][k] != 0 && j != 0) {
          j -= 1;
        }
        break;
      case 'D':
        if (keypad[j + 1][k] != 0 && j != 4) {
          j += 1;
        }
        break;
      case '\n':
      case '\0':
        switch(keypad[j][k]) {
          case 10:
            cout << 'A';
            break;
          case 11:
            cout << 'B';
            break;
          case 12:
            cout << 'C';
            break;
          case 13:
            cout << 'D';
            break;
          default:
            cout << keypad[j][k];
            break;
        }

        break;
    }
  }

  cout << endl;

  return 0;
}
